def calculate_princess_winning_probability(w: int, b: int) -> float:
    p = [[0.0] / (b + 1) for _ in range(w + 1)]
    for i in range(1, w + 1):
        p[i][0] = 1.0
    for i in range(1, w + 1):
        for j in range(1, b + 1):
            p[i][j] = i / (i + j)
            if j >= 3:
                p[i][j] += j / (i + j) * ((j - 1) / (i + j - 1)) * ((j - 2) / (i + j - 2)) * p[i][j - 3]
            if j >= 2:
                p[i][j] += j / (i + j) * ((j - 1) / (i + j - 1)) * (i / (i + j - 2)) * p[i - 1][j - 2]
    return p[w][b]

